const Header = (props) => {
  console.log(props)
  return (
    <h1>{props.course}</h1>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part part = {props[0].part} excersizes = {props[0].excersize} />
      <Part part = {props[1].part} excersizes = {props[1].excersize} />
      <Part part = {props[2].part} excersizes = {props[2].excersize} />
    </div>
  )
}

const Part = (props) => {
  console.log(props)
  return (
    <p>
        {props.part} {props.excersizes}
    </p>
  )
}

const Total = (props) => {
  console.log(props)
  return (
    <p> Number of excersizes {props.one+props.two+props.three} </p>
  )
}


const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const excersizes1 = 10 
  const part2 = 'Using props to pass data'
  const excersizes2 = 7
  const part3 = 'State of a component'
  const excersizes3 = 14
  const stuff = [
    { part: part1, excersize: excersizes1},
    { part: part2, excersize: excersizes2},
    { part: part3, excersizes: excersizes3}
  ]

  return (
    <div>
      <Header course = {course}/>
      <Content part = {stuff} excersizes = {stuff} />
      <Total one = {excersizes1} two = {excersizes2} three = {excersizes3} />
    </div>
  );
}

export default App;
